import React, { Component } from "react";

class SpecificUser extends Component {
  state = {
    nodeName: "Unknown",
    data: {
      keyOne: 10,
      keyTwo: 20,
      keyThree: 15,
      keyFour: 30
    }
  };
  render() {
    return <h1>Hello</h1>;
  }
}

export default SpecificUser;
